				"    branchName=`\"$git\" rev-parse --abbrev-ref HEAD`",
				"    /usr/libexec/PlistBuddy -c \"Set :CFBundleVersion $appBuild-$branchName\" \"${TARGET_BUILD_DIR}/${INFOPLIST_PATH}\"",
